import React from 'react'
const Card = (props) => {
  return (

    
      <div class="col-3">
        <img
          class='text-center'
          src="../../assets/images/creative.png"
          alt=""

        />
        <h2 class='text-center'>
          {props.title}
        </h2>
        <p class='text-center'>
          {props.soustitle}
        </p>
        <h6 class='text-center'>{props.signature}</h6>

      </div>
    




  )
}

export default Card
